begin Sound_MournEnv

if ( CellChanged != 0 )
	return
endif

if ( MournWeather == 7 )
	return
endif

if ( GameHour >= 6 )
	if ( GameHour <= 18 )
		if ( GetSoundPlaying "MournDayAmb" == 0 )
			PlayLoopSound3DVP "MournDayAmb", 1.0, 1.0
		endif
	endif
endif

if ( GameHour < 6 )
	if ( GetSoundPlaying "MournNightAmb" == 0 )
		PlayLoopSound3DVP "MournNightAmb", 1.0, 1.0
	endif
elseif ( GameHour > 18 )
	if ( GetSoundPlaying "MournNightAmb" == 0 )
		PlayLoopSound3DVP "MournNightAmb", 1.0, 1.0
	endif
endif



end
